const test = require('tape'),
  base64Img = require('base64-img'),
  looksSame = require('looks-same'),
  ImageSequencer = require('../../../src/ImageSequencer'),
  image = require('../images/IS-QR'),
  target = 'test_outputs',
  options = {
    offset: -1
  };

let benchmark = 'data:image/png;base64,';

let sequencer = ImageSequencer({ui: false});

test('blend module loads correctly', t => {
  sequencer.loadImages(image);
  sequencer.addSteps('brightness', {});
  sequencer.addSteps('blend', options);

  t.equal(sequencer.steps[2].options.name, 'blend', 'blend module is getting loaded');
  t.end();
});

test('blend module loads with correct options', t => {
  for (const option in options) {
    t.equal(sequencer.steps[2].options[option], options[option], `Option ${option} is correct`);
  }

  t.end();
});

test('blend module works correctly', t => {
  sequencer.run({mode: 'test'}, () => {

    let result = sequencer.steps[2].output.src;

    base64Img.imgSync(result, target, 'result');
    base64Img.imgSync(benchmark, target, 'benchmark');

    result = './test_outputs/result.png';
    benchmark = './test_outputs/benchmark.png';

    looksSame(result, benchmark, function(err, res) {
      if (err) console.log(err);

      t.equal(res.equal, true, 'blend module works correctly');
      sequencer = null;
      t.end();
    });
  });
});